import React from "react"

function Header()
{
    return(
        <React.Fragment>
            <div className = "headbody">

            <img width= "20%" className="myimage" src="https://www.worldanimalprotection.ca/cdn-cgi/image/width=1280,format=auto/siteassets/shutterstock_2461984615.jpg" alt="myimage" />

            </div>
        </React.Fragment>
    )
        


}
export default Header;
